class RootView extends View {
    initialize() {
        let environment = Hummer.env;
        this.style = {
            flexDirection: 'column',
            width: environment.availableWidth,
            height: environment.availableHeight,
            paddingLeft: 10,
            paddingRight: 10,
            paddingTop: 10,
        }

        this.testSrc();
    }

    testSrc() {
        let titleView = new Text();
        titleView.text = 'Image - Base64';
        titleView.style = {
            color: '#333333',
            fontSize: 16,
        };

        let layout = new View();
        layout.style = {
            flexDirection: 'row',
            alignItems: 'center',
            padding: 10,
            borderWidth: 1,
            borderColor: '#22222222',
            flexWrap: 'wrap',
        };

        let img1 = new Image();
        img1.src = imageBase64;
        img1.style = {
            width: 80,
            height: 60,
            resize: 'contain',
        };

        layout.appendChild(img1);
        this.appendChild(titleView);
        this.appendChild(layout);
    }
}

let imageBase64 = "data:application/json;charset=utf-8;base64,";

Hummer.render(new RootView());